 // SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

contract Ex3_15 {
    function myFun(string memory str) public pure returns (uint, string memory, bytes memory) {
        uint num = 90;
        bytes memory byt = hex"01";
        return (num, str, byt);
    }
}

